('22', 'course-v1:UQx1+UQ100+2014_Spring', 'edge.edx.org-f47bf8690e274935aae5214df648c4f2', '[{\"id\":\"e9737081-edb5-4f2d-8946-9964dbb0d53f\",\"name\":\"\",\"questions\":[{\"id\":\"40dadb6d-f66a-4289-97db-51476655efe6\",\"question\":\"35-year-old female recreational runner presents with a long history of diffuse pain along the posteromedial border of the right tibia over a 5cm distance which usually decreases with warming up.  She can often continue running and complete the training session.  Pain tends to recur after exercise and is often worse the next morning.  What features in the history distinguish this case of MTSS from other common causes of exercise induced lower leg pain.\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"66d88091-1ecc-4be8-9a99-0f2bb4197843\",\"question\":\"Discuss two theories regarding the etiology of MTSS.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"0a2a03f5-acc2-4a11-970b-5aa9898b9fa3\",\"question\":\"Many  risk factors for MTSS have been proposed in the literature.  However, discuss 4 common risk factors and relevance to prevention and    treatment. \",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"3aa6ed79-2960-467c-8728-bd31a0717156\",\"question\":\"Discuss the role of Xrays, U/S, Nuclear medicine and  MRI imaging.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"01397c1f-9598-435f-8ea4-0893abb0dfcf\",\"question\":\"She has a friend who had surgery for this condition. She is keen to hear what might be involved, success rates and rationale for the procedure. \",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-04 01:11:00', '2019-10-04 01:11:00'),
('23', 'course-v1:UQx1+UQ100+2014_Spring', 'edge.edx.org-b0b1926c3ddb49d786c9b8b1b50be101', '[{\"id\":\"971b451b-939b-4d76-8f68-b92e643cc8db\",\"name\":\"\",\"questions\":[{\"id\":\"0107f3b8-e3d2-4cf8-bfb1-ba80fb18c8f4\",\"question\":\"35-year-old female recreational runner presents with a long history of diffuse pain along the posteromedial border of the right tibia over a 5cm distance which usually decreases with warming up.  She can often continue running and complete the training session.  Pain tends to recur after exercise and is often worse the next morning.  What features in the history distinguish this case of Medial Tibial Stress Syndrome (MTSS) from other common causes of exercise induced lower leg pain.\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"9aa28387-606e-49c5-984b-a11f7d4a2206\",\"question\":\"Discuss 2 theories regarding the etiology of MTSS.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"c0bda282-cfe2-4dca-bb10-f12228019634\",\"question\":\"Many risk factors for MTSS have been proposed in the literature.  Discuss the common risk factors and relevance to prevention and    treatment. \",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"3860fb1b-1772-48a2-b429-c40bd5f2e660\",\"question\":\"Discuss the role of Xrays, ultrasound, Nuclear medicine and  MRI imaging.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"79266a26-5f23-4fa3-908d-ea9d72c57b4c\",\"question\":\"She has a friend who had surgery for this condition. She is keen to hear what might be involved, success rates and rationale for the procedure.\",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-04 01:41:23', '2019-10-04 01:41:23'),
