('29', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-4672b3a2744e4999987ab8abd3eda146', '[{\"id\":\"1ec25aef-ae6c-4919-b79f-d8f48e64eff3\",\"name\":\"\",\"questions\":[{\"id\":\"f12a8dfb-1d4d-469f-9aa5-8d4712da8274\",\"question\":\"You have been appointed Team Doctor for a senior team in your home state’s Australian Rules Football (AFL) competition. At your first meeting with the players, coaches and support staff, outline your general plan for the team regarding infection control / infection prevention. \",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"6a098be4-4328-43b4-b8d2-98804ce89ef9\",\"question\":\"The Team’s coach asks you to review the infection control plan for the clubhouse team change rooms and showers.  Outline your approach to reviewing this plan and implementing your new clubhouse infection control plan.  \",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"3356b665-0c3b-47b0-aa1d-30a69b10c263\",\"question\":\"On game days, what key elements of infection control would you advise and oversee to minimise the risk of infection to your players and support staff. \",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"91a073f0-754e-4838-88e8-bb28a2ae3d17\",\"question\":\"On the Monday morning prior to the Saturday of the semifinal match, one of the key players presents to your surgery saying he developed a ‘cold’ yesterday.  He wants you to give him some antibiotics so he can ‘get well’ and play in the semifinal in 5 days time. What key clinical symptoms and signs would you assess? What would you prescribe? Can he train this week? Can he play on Saturday?\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"9d2d8555-fbe1-4eeb-82e8-83c10d4438b3\",\"question\":\"A new player joins your team.  He reveals to you in his initial medical examination that he is a carrier of Hepatitis B.   What are the risks of transmission to other players? What are the risks of transmission to staff? How would you minimise these risks? Ethically, should he be