('48', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-9853db9f1110456eb7d374ef1be9257e', '[{\"id\":\"6e0da869-85cc-4f71-b5cf-1a4d8d979c5f\",\"name\":\"\",\"questions\":[{\"id\":\"18867952-6bcb-4364-bb12-44cb695071b4\",\"question\":\"3 minutes - A 19 year old FEMALE rugby union player (BMI 35) during an uncontested run changes direction (side-steps) and has a sensation of a “snap” in her right knee. A team mate thinks she heard a “pop”. The player was unable to continue. There was a DRAMATIC swelling of the knee in a short period of time. What features from the history of this case would make you suspect an ACL injury?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"f29d2e7c-dcc3-495d-841f-eb621390fccf\",\"question\":\"3 minutes - What is the role of Xrays in the investigation and differentiation of other pathologies in this case?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"c57d8a6a-3991-4920-8dc6-0bc4d8ee4de3\",\"question\":\"2 minutes - The patient is advised that they will NEED an ACL reconstruction. In a separate consultation they are eager to hear your views on the question “Do I need an operation?”\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"d6e85c3b-6cd3-4fbe-8545-1430d832279b\",\"question\":\"2 minutes - The patient is advised that they will need an ACL reconstruction. In the same consultation they are also eager to hear your views on the question “Could this happen again doctor?” \",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-11 06:44:26', '2019-10-11 06:44:26'),
