('51', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-87fb07a97de2432a97237b94fab11fee', '[{\"id\":\"3e411ac5-586e-467e-a481-44a827813e4d\",\"name\":\"\",\"questions\":[{\"id\":\"c08d8333-85d1-475c-ad68-d9b06daa2354\",\"question\":\"q1 - 3minutes\",\"settings\":{\"ask\":true,\"time\":130}},{\"id\":\"0adbc4e9-69af-4216-a94d-22c0108fcb90\",\"question\":\"q2 - 2minutes\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"be014768-e7e0-4b91-b504-106ad449aad7\",\"question\":\"q3 - 2minutes\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"84d3522d-173e-43ed-88ca-21105b8b870e\",\"question\":\"q4 - 2minutes\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"0aa8b59d-f48e-4072-94f0-fef62ba11feb\",\"question\":\"q5 - 2minutes\",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-14 10:48:10', '2019-10-14 10:48:10'),
('52', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-93fadaa4fc334eaf9725fe354c5c8b3f', '[{\"id\":\"96fcd9c2-d75d-45f4-8764-d133e1880342\",\"name\":\"\",\"questions\":[{\"id\":\"4e532cea-d99a-4b98-93d1-6fc68b4f7c12\",\"question\":\"90 seconds - How would you distinguish clinically between exercise associated collapse and exertional heat stroke?\",\"settings\":{\"ask\":true,\"time\":90}},{\"id\":\"21e31ace-c901-491d-8442-04f30409261c\",\"question\":\"90 seconds -  How would you treat a runner you clinically determine has exertional heat stroke? \",\"settings\":{\"ask\":true,\"time\":90}},{\"id\":\"61280413-4c4e-45cc-96d4-be8cd7b64b7b\",\"question\":\"120 seconds -  You are asked by your children’s local Hockey club to advise on a Heat Policy for the club.  How might you go about doing that?  What are the key elements of a heat policy which has the safety of athletes as its key goal?\",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-25 05:17:54', '2019-10-25 05:27:25'),
('53', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-6e357019e99d4fed83a05444b43d9acd', '[{\"id\":\"42bc7a20-a4eb-4fe8-b0c3-bcbf7c6dfc0d\",\"name\":\"\",\"questions\":[{\"id\":\"e1a60d63-a68c-4a19-a29a-6b0ae2c7440d\",\"question\":\"120 sec - 55-year-old male presents with a history of pain and stiffness at the back of the calcaneus in the morning that worsens with activity and severe pain the day after exercising.  The Achilles tendon insertion was painful at the midportion of the posterior aspect of the calcaneus.  Outline your medical history interrogation strategy to reveal associations relevant to a diagnosis of insertional Achilles tendinopathy.  \",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"d273f2de-6a48-41d2-bf5a-c008c755328c\",\"question\":\"90 sec - Although, often considered a clinical diagnosis, you arrange an MRI scan.  Discuss the findings supportive of the diagnosis and how this may influence your management advice. \",\"settings\":{\"ask\":true,\"time\":90}},{\"id\":\"fb7cf1f7-0158-4062-afa8-75824adc012c\",\"question\":\"90 sec - Discuss the non-operative options for this patient. \",\"settings\":{\"ask\":true,\"time\":90}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-25 05:23:39', '2019-10-25 05:23:39'),
