('56', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-24243defc74c43b6a4d52afe5d52fced', '[{\"id\":\"44c7ea6d-e4c3-4605-86d6-2f1bf7a450a8\",\"name\":\"\",\"questions\":[{\"id\":\"bad39cb7-0884-442f-b49d-43bfb0fc2e2d\",\"question\":\"Please give your Name\",\"settings\":{\"ask\":true,\"time\":10}},{\"id\":\"c211096d-7466-417d-a059-85737c26dd1b\",\"question\":\"Please give your course -SPMD7004\",\"settings\":{\"ask\":true,\"time\":10}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-29 00:32:50', '2019-10-29 00:32:50'),
('57', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-9b2bb7f1b086433a993ddcf93170a0a9', '[{\"id\":\"ac9c2b72-df6b-4031-b65b-8e404f3a34f6\",\"name\":\"\",\"questions\":[{\"id\":\"9dd3a788-05c0-4d7f-a3c8-f9a03648ca5c\",\"question\":\"3 minutes - A 22-year-old rugby league player presents with bilateral adductor origin pain  and centralized pubis symphysis pain.  Onset was insidious over a period of 2-3 months. He had a history of osteitis pubis 4 years earlier which resolved in 4 months.   He has a grade 1 L5/S1 spondylolisthesis, a left hamstring strain 9 months ago and  was treated for right sided Achilles tendinopathy 3 months ago.   Q\\tWhat additional information from history would be helpful in ascertaining the severity and staging of this case of athletic pubalgia. \",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"96d3e506-09c6-4e63-9d98-293e033dee0a\",\"question\":\"2 minutes - What clinical tests would you consider have good functional implications for this case.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"e7dfc511-e1e6-4562-980e-670cd039fd71\",\"question\":\"2 minutes - What would be your advice for the next 10 days regarding rest and pharmacological intervention. \",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":0}}]', '2019-10-29 00:45:10', '2019-11-16 00:48:33'),
('58', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-a30b7dc8774d479b85c3d58ad0b0c9e3', '[{\"id\":\"4f42d29b-523b-44d1-b363-574a7a40bc53\",\"name\":\"\",\"questions\":[{\"id\":\"18839431-3b21-4bfc-aea3-a0a8f81cec95\",\"question\":\"4 minutes - 60-year-old right-handed female golf player presents with left knee pain.  She had previously  had a partial lateral meniscectomy 20 years prior.   This amateur golfer has recently retired  and increased the amount of time on the course.  She was told that golf poses little risk of injury.  Can you rationalise this situation, explaining to the patient biomechanical factors pertinent to her situation.\",\"settings\":{\"ask\":true,\"time\":240}},{\"id\":\"8df545e0-d7d5-4b73-b674-26ab5fcc2f12\",\"question\":\"2 minutes - Under what circumstances would an MRI be warranted.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"54ede02d-4cec-4109-b90a-64fe874ec091\",\"question\":\"2 minutes - 60-year-old right-handed female golf player presents with left knee pain.  She had previously  had a partial lateral meniscectomy 20 years prior.   This amateur golfer has recently retired  and increased the amount of time on the course.  She was told that golf poses little risk of injury.  What preventative strategies could be recommended. \",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-29 01:09:13', '2019-10-31 04:47:58'),
('59', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-869f858fb0734392ac472ce3c34469c1', '[{\"id\":\"bc922805-7fd3-4eba-ad2f-d8170d07675a\",\"name\":\"\",\"questions\":[{\"id\":\"14f16daf-2d05-4b7f-8463-2033d2c61625\",\"question\":\"3 minutes - You are covering your local women’s AFL team.  One of your smaller players (22 yrs of age) runs in to tackle the opposing player.  Her head hits the other player’s forearm and your player falls to the ground like a ‘rag doll’ (She does not appear to put her hands out to try to protect herself as she falls.)  She does not move. What are your immediate main concerns? What do you do?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"a9831448-3d94-43f5-807f-c8f22602a7a7\",\"question\":\"3 minutes - One of your women’s hockey players is hit in the head by an extremely firmly hit ball bouncing up from the ground.  She comes off the field with a headache. How would you immediately assess her? She wants to stay on the sideline and watch the rest of the game.  What RED FLAGS would you keep an eye out for that might prompt you to send her to hospital?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"0966825c-7b6e-4d14-8753-f94a1578fb72\",\"question\":\"3 minutes - .  One of your club’s Rugby Union players is brought off the field after a knock to the head in a tackle.  How would you assess if he can return to play that day?  What tool(s) would you use?  What symptoms would you be asking about that could indicate concussion\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"5e3e6e63-7b63-44ad-bf8b-0ec5fd475c32\",\"question\":\"3 minutes - .  You decide that your Rugby union player in Q3 is concussed and do not allow him to return to play.  It is Saturday morning.  What immediate advice do you give him for the weekend? He wants to train on Thursday and play in the semifinal next Saturday.  Can he train?  Can he play? \",\"settings\":{\"ask\":true,\"time\":180}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-29 01:23:55', '2019-10-29 10:48:41'),
('60', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-63490642642e4d0eabdf53c9d6c9741a', '[{\"id\":\"53d11af2-c196-4653-b527-46cca5ed80d7\",\"name\":\"\",\"questions\":[{\"id\":\"2d7ed983-6ce5-45a6-8ce6-db047f02ef55\",\"question\":\"3 Minutes - A 25 year old women presents to your surgery for advice about exercising during her first pregnancy.  She is 6 weeks pregnant and well.  She weighs 100kg, she is worried about gaining lots of weight during pregnancy and developing gestational diabetes? She works at a reception desk and does no regular exercise.  Can exercise assist her?  If so what exercise program would you suggest?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"77cf526a-494a-4b32-9e6d-73e0b307d6be\",\"question\":\"3 Minutes - She returns 1 week later and says she has been speaking to friends and they advised her to join a gym and do ‘hot’ yoga and HIIT training as ‘that worked for them.’  How do you advise her?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"3da1cef5-c99e-4f4d-aaf1-b1d35c76f5bb\",\"question\":\"3 Minutes - One of your 29 year old patients is pregnant with her second child.  At her first antenatal visit she asks your advice about how much exercise it is safe for her to continue to do during the pregnancy?  She is active – she cycles to work most days, plays tennis on Saturdays and does aerobic workouts at the gym once or twice a week if she has time?  How would you advise her?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"45d93c16-b31f-4c3b-9217-127bd3add3bf\",\"question\":\"3 Minutes - Your 29 year old patient in Q2 returns to see you at 13 weeks. Her scan is fine.  She asks about doing resistance training at the gym as she has heard she should be doing this as well?  How would you advise her?\",\"settings\":{\"ask\":true,\"time\":180}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-10-29 01:29:43', '2019-10-29 01:29:43'),
('61', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-99cd50d8b9b042b4b70762cd89d4891d', '[{\"id\":\"8ed3f64d-d1ec-43ab-92d4-c234d2217b98\",\"name\":\"\",\"questions\":[{\"id\":\"edf956f0-0bba-4b7f-a1b0-359428253070\",\"question\":\"3 minutes - You are covering your local women’s AFL team.  One of your smaller players (22 yrs of age) runs in to tackle the opposing player.  Her head hits the other player’s forearm and your player falls to the ground like a ‘rag doll’ (She does not appear to put her hands out to try to protect herself as she falls.)  She does not move. What are your immediate main concerns? What do you do?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"c66df1f2-ef4a-4280-bfae-a56ef821103d\",\"question\":\"3 minutes - One of your women’s hockey players is hit in the head by an extremely firmly hit ball bouncing up from the ground.  She comes off the field with a headache. How would you immediately assess her? She wants to stay on the sideline and watch the rest of the game.  What RED FLAGS would you keep an eye out for that might prompt you to send her to hospital?\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"3af0ccc0-c6a4-4ca1-8a5f-f91687ec0e89\",\"question\":\"3 minutes - .  One of your club’s Rugby Union players is brought off the field after a knock to the head in a tackle.  How would you assess if he can return to play that day?  What tool(s) would you use?  What symptoms would you be asking about that could indicate concussion\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"879760a5-0476-4b36-9e72-81ee67b7f408\",\"question\":\"3 minutes - .  You decide that your Rugby union player in Q3 is concussed and do not allow him to return to play.  It is Saturday morning.  What immediate advice do you give him for the weekend? He wants to train on Thursday and play in the semifinal next Saturday.  Can he train?  Can he play?\",\"settings\":{\"ask\":true,\"time\":180}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-06 12:26:06', '2019-11-06 12:26:06'),
('62', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-071c4a6e0a31427babdc70301870cd76', '[{\"id\":\"99499538-e70c-4fe4-b6c6-1d0ca81f2ad4\",\"name\":\"\",\"questions\":[{\"id\":\"4f760adc-77d8-46b3-a15e-5fa2c09701cd\",\"question\":\"4 minutes - 60-year-old right-handed female golf player presents with left knee pain. She had previously had a partial lateral meniscectomy 20 years prior. This amateur golfer has recently retired and increased the amount of time on the course. She was told that golf poses little risk of injury. Can you rationalise this situation, explaining to the patient biomechanical factors pertinent to her situation.\",\"settings\":{\"ask\":true,\"time\":240}},{\"id\":\"3b6b3433-b1e3-4847-8faf-bc6e60529760\",\"question\":\"2 minutes - Under what circumstances would an MRI be warranted.\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"9b03d88d-197d-44d4-9ce8-927beae5cdcf\",\"question\":\"2 minutes - 60-year-old right-handed female golf player presents with left knee pain. She had previously had a partial lateral meniscectomy 20 years prior. This amateur golfer has recently retired and increased the amount of time on the course. She was told that golf poses little risk of injury. What preventative strategies could be recommended.\",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-06 13:14:34', '2019-11-06 13:14:34'),
('63', 'course-v1:UQx+HABS0579_6960_00001+2019_S2', 'edge.edx.org-b1f0a0b107a34a1e94b44e00990d68d1', '[{\"id\":\"4aebd47e-2c0b-4b7d-abf6-709e1126e7df\",\"name\":\"\",\"questions\":[{\"id\":\"af4a302a-7e48-4525-bca4-5a1306adc83e\",\"question\":\"test1\",\"settings\":{\"ask\":true,\"time\":20}},{\"id\":\"48ef76fb-988a-4119-89a6-803f3cde68dc\",\"question\":\"test2\",\"settings\":{\"ask\":true,\"time\":20}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-08 06:30:25', '2019-11-08 06:35:59'),
('64', 'course-v1:UQx+TEST0019N_6980_10001+2019_Summer', 'staging.learnx.uq.edu.au-e5c848922cb64e66981410be34a1de9a', '[{\"id\":\"b8b01e6a-e3e9-42ff-bf41-98bac5bc07de\",\"name\":\"\",\"questions\":[{\"id\":\"5652c97c-313b-497c-85ae-316ea4154379\",\"question\":\"Who is Stefani Germinotta?\",\"settings\":{\"ask\":true,\"time\":10}},{\"id\":\"7fa1fd44-882b-49b2-926b-eaea57646548\",\"question\":\"What is Madonna\'s full name?\",\"settings\":{\"ask\":true,\"time\":10}},{\"id\":\"9536e04e-e1ed-402c-8d5c-ee40463db893\",\"question\":\"Why are you working on Saturday?\",\"settings\":{\"ask\":true,\"time\":20}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-08 22:44:09', '2019-11-08 22:44:09'),
('65', 'course-v1:UQx+BUSLEAD5x+3T2019', 'courses.edx.org-e2c2357205ab4c6d85bacaa3c4466290', '[{\"id\":\"c8f20927-7a75-47ca-835b-22ac147a33c7\",\"name\":\"\",\"questions\":[{\"id\":\"b198da33-f3f0-4370-ba6d-59bb4dd166fd\",\"question\":\"Why have you chosen to pursue the MicroMasters Credential in Business Leadership?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}},{\"id\":\"6f5c001e-8cab-4035-8390-7cef636f346e\",\"name\":\"\",\"questions\":[{\"id\":\"e9cf4f63-808d-4045-8a2e-22505ac18cbb\",\"question\":\"What has been your favorite part of this MicroMasters program?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}},{\"id\":\"3382fa96-5696-480a-b307-57aec13c0dec\",\"name\":\"\",\"questions\":[{\"id\":\"473481f0-1ec7-48b2-bf3c-5dc6c77cdf2d\",\"question\":\"Where do you hope to be in your career in 5 years time?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-11 00:03:11', '2019-11-11 00:03:11'),
('66', 'course-v1:UQx+BUSLEAD5x+3T2019', 'courses.edx.org-9efb26674cbc4ab78614d41a7bd9c628', '[{\"id\":\"5a398d77-f1d9-482c-abaa-3e6bde54710f\",\"name\":\"\",\"questions\":[{\"id\":\"4482c4c1-8630-4a95-b757-41d38b8fc2ae\",\"question\":\"From your own experience and perspective, what is leadership?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}},{\"id\":\"21ea5420-7f45-43fe-bf06-74a20e7af02f\",\"name\":\"\",\"questions\":[{\"id\":\"cd7744aa-2da9-47e9-af74-e9760dc73238\",\"question\":\"What do you feel is most important in preparing to lead an organization?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"35af14cd-d0d2-44c1-a014-78bfa4eb6543\",\"question\":\"What is important about leader vision statements and how might you incorporate a vision statement in your current or next leadership position?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"a91c65f8-c986-4769-a43d-a8a62330ccb1\",\"question\":\"What are some ways of thinking that can help you make decisions and how will you incorporate these in your leadership practice?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"bb8e3fb1-235c-4c2f-8d1e-8686f8f03d62\",\"question\":\"What should a leader understand about change in organizations?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"1686526a-f0d0-4279-948e-804703abd9e2\",\"question\":\"What will you do as a leader to better prepare your organization to deal with crisis?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"6305ebb2-7702-4c21-be01-cf16c2526a2f\",\"question\":\"As a leader, what are some key considerations to better enable your organization to sustain itself over the long term?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":true,\"numberOfQuestionsToAsk\":1}},{\"id\":\"7f1cb4a9-7013-4802-9b32-63a1d96126ca\",\"name\":\"\",\"questions\":[{\"id\":\"43c2c9b2-bf97-4f7e-99e9-fff0ed6092d9\",\"question\":\"At your most recent workplace, what is one thing that could be done to better motivate and engage people?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"eea1cb74-0487-443c-b2cd-363604374e45\",\"question\":\"What kind of working relationship should new leaders in your organization try to establish with their followers, and why?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"b1047fcc-e090-4b05-8700-5883fecf9fe8\",\"question\":\"What changes could be made to your work group to foster better problem solving and innovation?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"77e1e049-8aaf-4a5e-a8bf-c77158eef8b6\",\"question\":\"Think of a situation where you have seen conflict spiral out of control – what could have been done differently to manage that conflict?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"442abb52-0050-40c8-b945-fc804afa7865\",\"question\":\"What should a leader understand about culture in organizations?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"d91f11ca-f7ae-46f3-af4c-663dbe60a263\",\"question\":\"In what ways is your current workgroup diverse, and how does that diversity impact group performance?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":true,\"numberOfQuestionsToAsk\":1}},{\"id\":\"102ec36f-f657-41a8-ad78-d954228589e2\",\"name\":\"\",\"questions\":[{\"id\":\"df3c6c7c-ab6d-467a-b381-1f9fcb900824\",\"question\":\"In your own words, what is the Aristotelain notion of eudaimonia and how is it relevant to your role as a leader?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"5147bfce-181e-4765-b147-9f5a0d1fb234\",\"question\":\"Wise leadership requires intellectual virtues and moral virtues. What do these terms mean, and how are they important to being an outstanding leader?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"02842cae-3d18-4a84-8abe-00919dacdd98\",\"question\":\"What macro-level problem facing humanity do you see as the most important, and what can you do as a meso-level leader to positively impact on this problem?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"44641b9a-85e9-4dc1-b2a2-8fcdb3e17beb\",\"question\":\"In contemporary times, what are the key differences between older concepts of leadership (e.g., transactional, charismatic) and newer concepts (e.g., transformational, authentic, servant) that make them more appropriate to outstanding leadership?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"09c15f8e-37f5-426e-920f-6ce0fa337f28\",\"question\":\"Throughout the program, a number of leaders provided advice for emerging leaders such as yourself.  What piece of advice did you consider to be the most valuable for you, and why?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"7b82ef1e-2991-473d-a44b-c04c80f45b2b\",\"question\":\"What is the relevance of ancient principles from the West, the East, and Indigenous philosophies to guide contemporary notions of wise leadership? \",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":true,\"numberOfQuestionsToAsk\":1}},{\"id\":\"712f6e50-403a-4683-a580-f5475ebc0975\",\"name\":\"\",\"questions\":[{\"id\":\"b3e1c761-bfd7-4052-84e3-0e3149ae721b\",\"question\":\"In what ways do you act as a Transformational Leader?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"152780f1-40ce-4c84-ba31-01c64275bfd8\",\"question\":\"What role does power and influence play in effective leadership?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"e7e0e198-e481-4e6f-a3e2-bbc98541d1b8\",\"question\":\"Why is your credibility pivotal to your ability to lead effectively?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"3c9ab3d5-e94c-4cab-b243-405204574bf4\",\"question\":\"What role does understanding the external environment play in being an effective leader?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"50597ad6-2da3-4317-b9db-a4fcb815facb\",\"question\":\"How might crisis leadership differ from the kind of leadership required during times of calm?\",\"settings\":{\"ask\":true,\"time\":60}},{\"id\":\"7dcde7c0-bfd8-4c8b-8a2b-d1620829de02\",\"question\":\"What are the key processes of Leadership Development?\",\"settings\":{\"ask\":true,\"time\":60}}],\"settings\":{\"randomise\":true,\"numberOfQuestionsToAsk\":1}}]', '2019-11-11 00:07:51', '2019-12-04 01:48:45'),
