('68', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-3407c50648304cddaaf5b73a40b881ba', '[{\"id\":\"ce743ea9-aa74-4646-a268-08107a59e292\",\"name\":\"\",\"questions\":[{\"id\":\"706fb83a-fbf6-4763-bfbe-9fd9fa95baff\",\"question\":\"3 minutes - A 22-year-old rugby league player presents with bilateral adductor origin pain  and centralized pubis symphysis pain.  Onset was insidious over a period of 2-3 months. He had a history of osteitis pubis 4 years earlier which resolved in 4 months.   He has a grade 1 L5/S1 spondylolisthesis, a left hamstring strain 9 months ago and  was treated for right sided Achilles tendinopathy 3 months ago.   Q\\tWhat additional information from history would be helpful in ascertaining the severity and staging of this case of athletic pubalgia. \",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"231860a0-5b51-4fdc-ac02-0f700941e3b3\",\"question\":\"2 miutes - What clinical tests would you consider have good functional implications for this case.\\t\",\"settings\":{\"ask\":true,\"time\":120}},{\"id\":\"38a659d4-6ecd-46d0-897e-82514404a0c2\",\"question\":\"2 minutes - What would be your advice for the next 10 days regarding rest and pharmacological intervention. \",\"settings\":{\"ask\":true,\"time\":120}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-16 01:10:59', '2019-11-16 01:10:59'),
('69', 'course-v1:UQx+HABS0579_6960_00002+2019_S2', 'edge.edx.org-719d09297b8f41528fc1c57145c7dd7f', '[{\"id\":\"d69af2db-b808-4aad-bcab-7d0c1b1aef36\",\"name\":\"\",\"questions\":[{\"id\":\"62d9d13a-2ee8-4488-80cd-4fc365fd433c\",\"question\":\"You excised a pigmented lesion from this healthy 46 year male 2 weeks ago. He has been away until today and he has returned for removal of his stitches. Please give the result of the biopsy to the patient and outline any further management to him. MACROSCOPIC EXAMINATION  The specimen is an ellipse of skin and fat measuring 19 x 9 x 4.5 mm deep. It carries a mottled light brown maculopapular lesion about 6 x 4 mm. 4TS.[JK]  MICROSCOPIC DESCRIPTION  Sections show melanoma in situ of superficial spreading type over a dysplastic dermal component that has some features of Spitz naevus including some epithelioid cells and there is some regression, both early (non-brisk lymphocytic infiltrate) and some dermal fibrosis. A regressing dermal component of borderline malignancy is a possibility and it measures 0.5mm thick (Breslow) and Clark level II. No dermal mitosis is seen. There is mild acanthosis and no ulceration is seen. No neurovascular involvement is seen. The dermal component is largely banal naevus cells with a small zone of spindle cells and the few epithelioid cells mentioned before. The lesion is 1.1mm from the side margin and 2.9mm from the deep edge and appears fully removed.  CONCLUSION      SKIN, RIGHT LATERAL KNEE -- SUPERFICIAL SPREADING MELANOMA  Copy to NSW Cancer Registry Thank you for this specimen referral. Electronic signature: Dr Geoff O\'Brien (O\'Brien Pathology) 26/11/2008\",\"settings\":{\"ask\":true,\"time\":200}},{\"id\":\"5ad3835c-4419-49be-af70-74451c75fda7\",\"question\":\"Q2\",\"settings\":{\"ask\":true,\"time\":180}},{\"id\":\"96f89dc7-f66d-4741-a59b-03bc48ec0a7b\",\"question\":\"Q3\",\"settings\":{\"ask\":true,\"time\":180}}],\"settings\":{\"randomise\":false,\"numberOfQuestionsToAsk\":1}}]', '2019-11-22 03:10:10', '2019-11-22 05:06:59'),
